import portfolioImg from '../../images/strelka.svg';
import React from 'react';
import './Portfolio.css';

function Portfolio() {
    return (
        <section className="portfolio">
            <div className="portfolio__title">Портфолио</div>
            <ul className="portfolio__info">
                <li>
                    <div className="portfolio__name">Статичный сайт
                    </div>
                    <img src={portfolioImg} alt="Стрелка" className="portfolio__img" />
                </li>
                <li className="portfolio__name">Адаптивный сайт
                    <img src={portfolioImg} alt="Стрелка" className="portfolio__img" />
                </li>
                <li className="portfolio__name">Одностраничное приложение
                    <img src={portfolioImg} alt="Стрелка" className="portfolio__img" />
                </li>
            </ul>
        </section>
    );
}

export default Portfolio;
